INSERT INTO `films` (`id`, `title`, `release_date`, `poster_path`, `overview`, `poster`) VALUES
('1001865', 'Scrooge: A Christmas Carol', '2022-11-18', '/nOrnzHn9SCF6JTXfX02eSPyAAXL.jpg', 'On a cold Christmas Eve, selfish miser Ebenezer Scrooge has one night left to face his past — and change the future — before time runs out.', NULL),
('1004663', 'All the Beauty and the Bloodshed', '2022-11-23', '/cvO51xxtIUHc5w5ZgFsigiFaUaO.jpg', 'Following the life of artist Nan Goldin and the downfall of the Sackler family, the pharmaceutical dynasty who was greatly responsible for the opioid epidemic\'s unfathomable death toll.', NULL),
('1008181', 'Pedestal', '2022-11-11', '', 'A family embarks an adventure to find what makes them the happiest.', NULL),
('1008773', 'Doctor Who Am I', '2022-10-28', '/ocCGXs1XuYgpk4jvv9dGdaKni5P.jpg', 'In 1996, a Doctor Who TV movie was envisioned to lead the franchise into an exciting new future with a fresh direction but was met only by an outcry from disapproving fans. Now, follow the film’s screenwriter, Matthew Jacobs, as he is pulled back into the world of the Doctor Who fandom, where he unexpectedly finds himself a kindred part of this close-knit, yet vast, family of fans.', NULL);
INSERT INTO `films` (`id`, `title`, `release_date`, `poster_path`, `overview`, `poster`) VALUES
('1012906', 'An Inconvenient Love', '2022-11-25', '/b4ktC7OCLXwnhcjNsHfmC7lipCd.jpg', 'Ayef meets Manny. It is at a time where she focuses on her dreams while Manny being a flighty young shop owner, goes with the flow. They both believe love is inconvenient and agree to a contractual fling expiring on the date Ayef leaves for Singapore, but they start falling for one another.', );
INSERT INTO `films` (`id`, `title`, `release_date`, `poster_path`, `overview`, `poster`) VALUES
('1014629', 'The Fearway', '2022-11-14', '/b7cJsO84zQOKTyYHFjrsyIxzwYy.jpg', 'A young couple travelling down the freeway seem to be unable to get off the road after being hunted by someone intent on keeping them on the road.', NULL),
('1014884', 'In Her Hands', '2022-11-16', '/h9Hy8PN25fik7oRTtnE7XnJOvK0.jpg', 'As Western forces withdraw, Afghanistan\'s youngest female mayor braves mortal danger to lead a fight for education for the next generation of Afghans.', NULL),
('1014890', 'Louis Armstrong\'s Black & Blues', '2022-10-27', '/j7Bol8Tdm0S8GVNXgbQSOS5AVpD.jpg', 'An intimate and revealing look at the world-changing musician, presented through a lens of archival footage and never-before-heard home recordings and personal conversations. This definitive documentary honors Armstrong\'s legacy as a founding father of jazz, one of the first internationally known and beloved stars, and a cultural ambassador of the United States.', NULL),
('1015432', 'Rosé All Day', '2022-11-11', '/wfRU72anzN0zjANI6oyzKrNpQaF.jpg', 'Centers on a group of college friends who meet once a year for their \"Rosé All Day\" pool party. After years the cracks in their relationships become all-consuming sinkholes filled with vomit, tears and confessions.', NULL),
('1015539', 'Santastein', '2022-11-12', '/o43xMzBcP5nODsQOYfF2RVTYwCa.jpg', 'When Max Causey was six, he accidentally killed Santa. 12 years later, Max rectifies his mistake by resurrecting him, but soon realizes the creature he created is a bloodthirsty killer and it\'s headed right to his friend\'s Christmas party.', NULL),
('1015936', 'Feed', '2022-10-28', '/ub9mz6YjdWfu87dJQBAxJHKcK5m.jpg', 'A group of social media experts are hired to help an old family business to strive. But they soon find themselves stuck on a tiny island in a lake in which an ancient Swedish witch is said to live.', NULL),
('1015990', 'Paul\'s Promise', '2022-10-21', '/hzatqqegzJPWPKy06BO9hJ87YXL.jpg', 'Set in the peak of the 1960s Civil Rights movement, “Paul\'s Promise” is the inspiring true story of Paul Holderfield, former racist firefighter-turned-pastor who started one of the first integrated churches in the American South. It’s one man’s journey to hope and healing during a troubled time in our Nation’s history that resulted in one man’s decision to serve God and stand up to injustice - a story that continues to make a huge impact on the community to this day.', NULL),
('1017036', 'Let There Be Drums!', '2022-10-28', '/6eQdFOPMmwS6uNciIgJmbJojkwD.jpg', 'Through conversations with the world\'s greatest drummers, director Justin Kreutzmann explores the importance of music in bringing people together.', NULL),
('1019391', 'Retrograde', '2022-11-11', '/j5TdrGSgqye6JXgXlymzQIZF1W6.jpg', 'The story of the last months of the 20-year war in Afghanistan through the intimate relationship between American Green Berets and the Afghan officers they trained.', NULL),
('1019418', 'The Corridors of Power', '2022-11-25', '/dqu5JSYjno8fouvowEBuCKk1sfl.jpg', 'How do the well-meaning and highly educated men and women of America’s foreign policy elite, dreaming of doing good in the world, so often find themselves presiding over disastrous wars and genocides? Master filmmaker Dror Moreh takes us deep inside the three decades of American foreign policy since the fall of the Berlin Wall, a period of almost constant war and mass killing', NULL),
('1024546', 'Detective Knight: Rogue', '2022-10-21', '/2wj5iUJ2B5AQ1lFctJgUrHHsp9B.jpg', 'As Los Angeles prepares for Halloween, mask-wearing armed robbers critically wound detective James Knight’s partner in a shootout following a heist. With Knight in hot pursuit, the bandits flee L.A. for New York, where the detective’s dark past collides with his present case and threatens to tear his world apart…unless redemption can claim Knight first.', NULL),
('1024627', 'The System', '2022-10-28', '/5v3grtPk3QSdjDP8ggpylA3hgIy.jpg', 'When a young soldier, newly returned from war, gets caught up in a drug bust, he is recruited by the authorities to go undercover in a notoriously dangerous prison in order to figure out what is really going on.', NULL),
('1024764', 'First Responders', '2022-10-24', '/mZ7JSimktMQt5sW8SKJNOEaJYH6.jpg', 'Karen Williams, a trauma therapist, has witnessed firsthand the special courage that shapes those who work in emergency services. But when her husband, a career firefighter, returns from a life-changing blaze, and she discovers that a degree and years of counseling first responders has done little to personally prepare her to help her husband’s battle with PTSD.  Unable to see a path to save her marriage, she turns to God and celebrates the truth that through Him all things are possible. Perhaps no one knows this better than the brave men and women who provide emergency services: the ones we call “first responders.”', NULL),
('1025881', 'Bobcat Moretti', '2022-11-06', '/1J8hgJRbszmVoHUNGDF8TvOKMea.jpg', 'An obese multiple sclerosis patient takes up his late Father\'s sport of boxing to overcome personal tragedy and find inner peace. \"Bobcat Moretti\" was filmed over the course of ten months, during COVID-19, allowing our lead actor to lose 154 pounds and embody the role.', NULL),
('1027121', 'Revelation To The Disembodied', '2022-11-19', '/q5opkh4xW9iAdGEz0mzHySQgkar.jpg', 'Fragments of a collective post-human dream construct a world that straddles hyper-technological, ecological, and mythological dimensions.', NULL),
('1027385', 'Dangerous Game: The Legacy Murders', '2022-10-21', '/1Dlj0TbLNtGHq42HE0fLnawtyyD.jpg', 'A family reunion at a remote mansion takes a lethal turn when they are trapped inside and forced to play a deadly survival game where only one will make it out alive.', NULL),
('1031038', 'Hopper: An American Love Story', '2022-10-11', '/6EkiAGyEPeq8d28ddVkTqpLQvqW.jpg', 'Short of hanging the painting on your living room wall, Phil Grabsky’s popular Exhibition on Screen series may be the best way to spend quality time with a favourite artist. At least, that’s what it feels like as we’re immersed in the infinitely evocative oils of Edward Hopper, a poet with a paintbrush.  The film draws on leading experts and curators, Hopper’s diaries and letters, but of course, the best reason to watch it is to bathe in close-ups of superb art.', NULL),
('1034045', 'Hayride to Hell', '2022-10-26', '/tXhZYtN06amWgBFGGyRK438kIPc.jpg', 'A small town farmer exacts his bloody revenge on unscrupulous town folk who try to steal his land.', NULL),
('1034273', 'Liam Gallagher: Knebworth 22', '2022-11-17', '/cen2RmkuAbB3HYi0TNhG1NgjMr3.jpg', 'Liam traces back to the site of his former band’s defining performances, incorporating all-new interviews, behind the scenes and concert footage captured from 20 camera positions. The film explores and seeks out stories and perspectives from collaborators and fans from diverse generations from around the world, transposing the emotional and social context of the 90s’ shows versus the tumult of our current era.', NULL),
('1034433', '2022 League of Legends World Championship', '2022-11-05', '/iR4Q82vmV2HR36p5TXIau7IgVLb.jpg', 'Don’t miss any of the action, strategy, and skill from the world’s best League of Legends players as the excitement of the World Final is broadcast live from the Chase Center in San Francisco, CA.  This cinema viewing party experience lets gamers come together with other players, receive commemorative thunder sticks (while supplies last), special Worlds 22 Game Capsule (from participating theatres), and an unprecedented Opening Ceremony performance by Grammy-award winning artist Lil Nas X.', NULL),
('1034673', 'Bathtub Shark Attack', '2022-11-01', '/1zf10mVZoWwWEIfQTLgg7PfEC9v.jpg', 'A young down-on-their-luck couple settle for a cheap apartment that seems too good to be true. Little do they know, something lurks in the drain of the bathtub. Something that\'s thousands of years old...and it is hungry.', NULL),
('1035462', 'The Domestic', '2022-10-21', '/qKs4yuq9d4qO0HvYxY4cArRseHY.jpg', 'An upper-class couple hire the daughter of their recently deceased housekeeper as their new helper, only for things to take a dark and macabre turn when she tries to destroy them from within.', NULL),
('1035962', 'Adios Amor', '2022-11-13', '', 'In Adios Amor, the discovery of lost photographs sparks the search for a hero that history forgot—Maria Moreno, a migrant mother driven to speak out by her twelve children’s hunger. Years before Cesar Chavez and Dolores Huerta launched the United Farm Workers, Maria picked up the only weapon she had—her voice—and became an outspoken leader in an era when women were relegated to the background. The first farm worker woman in America to be hired as a union organizer, Maria’s story was silenced and her legacy buried—until now.', NULL),
('1036561', 'Shadow Master', '2022-11-04', '/67ZsRKbItt6B1yHlsJKgfPWOyuJ.jpg', 'After being slain by a group of criminals, a man is reborn with animal-like superpowers and makes it his mission to right the wrongs of his city.', NULL),
('1036720', 'Dylan & Zoey', '2022-11-11', '/qpb4kqFVAj3HFHMIqxI5QfiIogL.jpg', 'On the heels of a godforsaken bachelorette party, Zoey has only 24 hours left in LA. She takes a chance and reaches out to her estranged best friend, Dylan. He is initially caught off guard, but the two nevertheless try to pick up where they left off. They tease, they laugh, they drink, but they know there is still the unspoken left between them.', NULL),
('1036740', 'The Voice of Dust and Ash', '2022-11-18', '/9vylAKKdUE8zJRJI4NPIa1IsaIZ.jpg', 'When Iran’s ayatollah banned music and performances in the entire country, instruments and records became contraband, and artists were  exiled, imprisoned, or executed.  As the new government began to crush  basic human rights, Maestro Shajarian risked everything to confront the regime, singing truth to power and uniting the country in a chorus of millions strong. His life long pursuit of equality through art is immortalized for generations to come, through his majestic, soaring vocals and lyrics. His internationally renowned hymn, “MORGHE SAHAR”, performed at the finale of all his concerts  is widely considered the Unofficial National Anthem for Iranian Freedom.', NULL),
('1037391', 'Christmas in Paradise', '2022-11-11', '/6WKIDanEhGkaEmoEoxntk1YBcqj.jpg', 'Joanna’s plans for a quiet, cozy holiday season are shattered when her sisters call with the news that their dad has been dumped by his fiancée and has disappeared to Nevis, a tiny Caribbean island, and is not responding to any calls. The sisters decide to go to the island to save their father and bring him home for Christmas. Can the newly reconnected Christmas family survive a crazy Christmas?', NULL),
('1037643', 'Dante\'s Hell', '2022-11-24', '/3QwYSUGq7aHsD6WPtjuqtXMzp2a.jpg', 'Dante goes on a journey through the first and worst part of the afterlife, Hell. Virgil guides and protects Dante on his dark journey descending circle-by-circle to the center of the Earth, and out into Purgatory (sequel).', NULL),
('1037644', 'Battle for Saipan', '2022-11-25', '/aWLR3s0EpqZYXNXXHVH0GCu6Gru.jpg', 'A Surgeon defends a hospital from invading enemy forces in the Battle of Saipan during World War II.', NULL),
('1039599', 'The Freeway Killer: Lost Murder Tapes', '2022-10-23', '/73lGVWz7apbHBwMbXTJKDYnkkS2.jpg', 'In 1970s California, a serial killer dumps young boys\' bodies along the freeways. An L.A. street reporter on the case receives information that embroils him in the dilemma of a lifetime. Decades later, lost confession tapes help experts uncover the truth.', NULL),
('1039627', 'L.O.L. Surprise! Winter Fashion Show', '2022-10-24', '/ik65OsEXbik1I0Di7SX9Sqv04e9.jpg', 'The collection with which Neonlicious was to make her debut mysteriously disappears. Now you have to use all your creativity and improvise new designs for the big parade!', NULL),
('1040504', 'Going All The Way - The Director\'s Edit', '2022-11-07', '/smcjqTwbK0Iu9VbYcygbAj6A8Rz.jpg', 'Mark Pellington\'s adaptation of Dan Wakefield\'s seminal novel. An elegant and morally complex tale about two young high school alumni and Korean war veterans returning to their sheltered Indianapolis community, only to find they no longer fit in. As classmates, shy, artistic Sonny and charming, popular Gunner had nothing to do with one another, but now, in the stifling climate of Eisenhower America, where prejudice and paranoia rule the day, the two young men find in each other the strength to change their lives and futures. Each must choose between the suffocating, but familiar comforts offered to them by their mothers and their old flames and friends, or the exciting, but uncertain futures represented by a pair of enthralling new romantic prospects. Originally released in 1997, the newly re-edited and restored version completely upends the original cut, hews closer to the source novel.', NULL),
('1040964', 'Moments: Mother', '2022-11-02', '/4rO72LvX80iII22zmDZqzZTUHZt.jpg', 'A woman looking for her kidnapped son finds one of the men who took him.', NULL),
('1041485', 'Torn', '2022-10-27', '/deBgM868e3oKKI6iuNWdDG2dVE9.jpg', 'Everything Ivy Morgan thought she knew has been turned on its head. If she doesn\'t figure out who she can trust-and fast-it\'s not only her heart that will be torn apart, but civilization itself.', NULL),
('1043577', 'Long-Term Coffee Break', '2022-11-15', '', 'A story about love and sex between a women and a man: Yuko is working at a major corporation and has a good salary.', NULL),
('1043623', 'Six Feet', '2022-10-30', '/AaMeaxJ19mUISHO0CAXbghGvNQh.jpg', 'A lone front desk attendant in an isolated motel must battle his anxiety disorder, cleaning obsession and possible motel contamination while serving quarantined guests in the middle of a deadly global pandemic.', NULL),
('1044385', 'BKFC 32: Reginald Barnett Jr. vs Geane Herrera', '2022-11-05', '/AaYE8togBcg9EwfgEILmr8r16zZ.jpg', 'Reginald Barnett Jr. vs Geane Herrera\r Jared Warren vs Jay Jackson', NULL),
('1044851', 'A Quarter of Silence', '2022-10-29', '/c2GJeqfuLWiPA2PLlvHstlzOV79.jpg', 'Two young parents that loses their drive for affection and goes through one night of silence that reignites their proclivity for love.', NULL),
('1044854', 'Remember the Drumstick', '2022-11-04', '/7dWYo31JANRpMpVA5hAJqhyEFzK.jpg', 'The documentary REMEMBER THE DRUMSTICK explores the rise and fall of a family owned fried chicken restaurant in Lincoln, NE turned rock and roll club in the 1980s, and the young enigmatic man, Tim Lohmeier, who made it the unforgettable legend of its time.', NULL),
('1045203', 'The Club', '2022-11-05', '/xJlBP3gG2u4FG3lR6wcoNeC349R.jpg', 'With a partner on the wrong side of a mass shooting, Theo Abney must overcome his personal rage to see that his boyfriend makes it out alive.\r An LGBTQ film based on the Pulse Nightclub shooting.', NULL),
('1047249', 'A Star Without a Star: The Untold Juanita Moore Story', '2022-11-09', '/cC6QhsWKhyGJL6zBjBQXY4aY4rf.jpg', 'A group of unknowns noticed that a legendary actress had no star on Hollywood\'s Walk of Fame.', NULL),
('1048099', 'Babezilla vs The Zombie Whorde', '2022-11-17', '', 'It seemed like a normal day of booty shaking for Babezilla until the evil tweaker pimps\' scheme to hypnotize the women of the internet into being their whores accidentally turned them into the ravenous Zombie Whorde! Babezilla to the rescue!', NULL),
('1048228', 'All the Pretty People', '2022-11-18', '/iLpBUqmSPPgmP8RUf4vRoU8q7GW.jpg', 'Set in the Land of the Freaks and the Home of the Depraved, Sam and Adrian, a young queer couple growing apart, endure a dystopian date night at The Country Club, a patriotic floorshow promoted by Adrian’s enigmatic sugar daddy, Fox.', NULL),
('1048232', 'Our Lady of Sorrows', '2022-11-18', '/cI7IuYvrLQoq9LyteLEeDU1N7oK.jpg', 'Years after an assault that left her physically and mentally scarred, a young nurse is forced to confront her shattered past when the man who attacked her ends up in her care.', NULL),
('1049767', 'The Chosen: Season 3 - Episodes 1 & 2', '2022-11-18', '/bGdEtvWSlYVFUKil9GNXOYnO7jE.jpg', 'After Jesus completes a sermon that turns the world upside down, all 12 disciples (including newcomer Judas) are ready to follow him to the ends of the earth. But problems remain.', NULL),
('1050401', 'Moomin', '2022-11-18', '', 'An eager romantic attempts to win over an ex partner with a Moomin plush toy in a virtual claw game.', NULL),
('1050403', 'Papel', '2022-11-18', '', 'A lonely axolotl child draws pictures of their absent parents and dreams of happier days. Through their art, they find that a loving family may not be that far away.', NULL),
('1050721', '\"I Fell in Love With the World\"', '2022-11-19', '/oeHzyoSonWv7qkREkQjgRUr33np.jpg', 'A series of surreal vignettes at an American Diner.', NULL),
('1050889', 'The Chosen: Season Three Begins', '2022-11-18', '/qyGH37EnbXCV9uXIGfTjWKfyxyA.jpg', 'What now? After Jesus completes a sermon that turns the world upside down, all 12 disciples (including newcomer Judas) are ready to follow him', NULL),
('1051155', 'Craven Gap', '2022-11-19', '/fVqy9y4kjAm2k18zpQUrNyAkBVb.jpg', 'A newlywed couple drifts off to sleep in a cozy cabin, only to be awakened by a terrible noise... A haunting folktale brought to life through experimental illustration.', NULL),
('1051156', 'Murmur', '2022-11-19', '', 'A faint sound typically signaling disease or damage. A rumor. Sometimes the heart betrays you.', NULL),
('1051160', 'Home', '2022-11-19', '', 'Since the war has begun, Iranians have welcomed thousands of Afghan people. As a result of the war crisis, two Afghan painters left their country and started painting the houses of others in Iran.', NULL),
('1051272', 'Entangled as Species', '2022-11-13', '', 'Daily observations and reflections of the second year of living in a pandemic. Our lives are limited to visits to the local Windmill Hill City Farm where animals and humans seem to live in harmony. I came across articles and videos about horseshoe crabs and their amazing survival through centuries and their impact on our survival. The farm shuts down and reopens as the vaccines roll out. The horseshoe crabs are on the verge of being added to the endangered species list. Like the old Farsi rhyme that Jonah tries to learn, we are in a circle tightly entangled.', NULL),
('1051356', 'The Chosen: Season 3 Theatrical Event', '2022-11-18', '/qyGH37EnbXCV9uXIGfTjWKfyxyA.jpg', 'What now? After Jesus completes a sermon that turns the world upside down, all 12 disciples (including newcomer Judas) are ready to follow him to the ends of the earth. But problems remain. Matthew wrestles with estrangement from his family. Andrew visits an imprisoned John the Baptist. Mary and the women must find a source of income. Simon and Eden face the costs of following Jesus. Most importantly, the disciples face their biggest challenge yet when Jesus sends them out, two by two, to preach and perform miracles without him. Episodes 1 & 2 of Season Three pick up where Season Two left off, and in this unique theatrical experience, launch the most emotional and consequential season of The Chosen to date.', NULL),
('1051380', 'Blue Lightning', '2022-11-22', '/a2ao6XBCcPYIKw3hqTd1gCzYN48.jpg', 'A grumpy, old man\'s life turns upside down when he discovers a mischievous orphan is his granddaughter - until they bond over soap box derby racing.', NULL),
('1051386', 'Smashed', '2022-11-20', '/e4Fehhmy66QdaUV6m0f0U5s1UjR.jpg', 'A new recruit attempts to make it big in the modern cutlery industry.', NULL),
('1051435', 'Andromeda', '2022-10-31', '/tr12gW9tqHJ4jypEpNuE5vRtAOw.jpg', 'A young man must travel to the furthest reaches of the universe to find his long lost father.', NULL),
('1052564', 'B-Roads', '2022-11-22', '', 'Follows the band Blur during the The Great Escape era.', NULL),
('1053446', 'Fifa World Cup 2022 - Qatar vs Ecuador', '2022-11-20', '/ykV0JMJKS90pEr5WjaJ3ABrebQy.jpg', '', NULL),
('1053458', 'Fifa World Cup 2022 - Senegal vs Netherlands', '2022-11-21', '/lCMXR5o5W7odL8DUXsPUFkhk0aD.jpg', '', NULL),
('1053548', 'Fifa World Cup 2022 - England vs Iran', '2022-11-21', '/g9YjcnOiUJwBx9dcGf4A05AIfR0.jpg', '', NULL),
('1053888', 'The 22nd Annual Animation Show of Shows', '2022-11-18', '/jYNLVAu5dCDb81onxJyi4d9igsI.jpg', 'This 22nd edition comprises 10 films -- nine recent, along with one restored classic -- which deal with both the anxieties and hopes of a world faced with a seemingly endless series of existential crises. All are inventive, their tone ranges from the whimsical to the profound; their techniques, from stop-motion to hand-drawn to computer-aided.', NULL),
('1054239', 'Billy Strings: 2022.10.15 - The Criterion - Oklahoma City, OK', '2022-10-15', '/7okBOArvkpsxZNTX5BIb7RfY7ed.jpg', 'Set 1: 1. Key Signator 2. I\'ll Remember You, Love, In My Prayers 3. On The Line 4. Train 45 5. Likes Of Me 6. Hide & Seek 7. All Of Tomorrow 8. If I Lose 9. Must Be Seven 10. Black Clouds 11. Running The Route 12. Running  Set 2: 1. Dos Banjos 2. Everything\'s The Same 3. Nothing\'s Working 4. Doin\' My Time 5. So Many Miles 6. Ice Bridges 7. Rank Stranger 8. Red Daisy 9. Ready For The Times To Get Better 10. This Heart Of Mine 11. Brain Damage 12. Highway Hypnosis 13. Love & Regret 14. Pretty Daughter 15. Away From The Mire  Encore: 1. Tennessee', NULL),
('1054241', 'Billy Strings: 2022.11.05 - Petersen Event Center - Pittsburgh, PA', '2022-11-05', '/coYViQ35M4QkyhWltiptPtzhhB1.jpg', 'Set 1: 1. Taking Water 2. Running 3. Watch It Fall 4. I\'ll Remember You, Love, In My Prayers 5. Run Down 6. Wargasm 7. A Good Woman\'s Love 8. Think Of What You\'ve Done 9. Thirst Mutilator 10. So Many Miles 11. Enough To Leave 12. Little Maggie  Set 2: 1. Dos Banjos 2. On The Line 3. Train 45 4. All Of Tomorrow 5. Wild Bill Jone 6. Highway Hypnosis 7. Love Like Me 8. Hold That Woodpile Down 9. Libby Phillips Rag 10. Doin’ Things Right 11. Sophronie 12. West Dakota Rose 13. My Love Come Rolling Down 14. Hide & Seek  Encore: 1. Freedom', NULL),
('1054242', 'Billy Strings: 2022.11.09 - Blue Cross Arena - Rochester, NY', '2022-11-09', '/wf8AYn1i7KZGxRZw0xdHNZvenIY.jpg', 'Set 1: 1. Old Train 2. Turmoil & Tinfoil 3. Running The Route 4. Stone Walls & Steel Bars 5. Fire Line 6. Running 7. Ashland Breakdown 8. The Train That Carried My Girl From Town 9. Black Mountain Rag 10. Love & Regret 11. Bronzeback 12. Must Be Seven 13. In The Morning Light 14. Everything\'s The Same  Set 2: 1. Heartbeat Of America 2. Red Rocking Chair 3. Hollow Heart 4. While I’m Waiting Here 5. Pyramid Country 6. And Your Bird Can Sing 7. I\'ve Been All Around This World 8. The Fire On My Tongue 9. Airmail Special 10. Hellbender 11. John Deere Tractor 12. Tipper 13. Dust In A Baggie  Encore: 1. Cold Cold World 2. Roll On Buddy, Roll On 3. The Gold Rush', NULL),
('1054246', 'Billy Strings: 2022.11.11 - Nassau Veterans Memorial Coliseum - Uniondale NY', '2022-11-11', '/hdXD9jyLRb2lpiLPYHJv9LlQqBn.jpg', 'Set 1: 1. Know It All 2. Little Maggie 3. Watch It Fall 4. Red Daisy 5. Hellbender 6. Away From The Mire 7. Long Forgotten Dream 8. Living Like An Animal 9. New Country Blues 10. Love Like Me 11. Dark Hollow 12. Key Signator 13. Wargasm  Set 2: 1. Proud Mary 2. Thunder 3. This Old World 4. Secrets 5. My Alice 6. Home 7. Spinning 8. Planet Caravan 9. Tentacle Dragon (Revenge Of The) 10. Uncle Pen 11. Show Me The Door 12. Meet Me At The Creek 13. Ride Me High 14. Meet Me At The Creek  Encore: 1. Gone A Long Time 2. If Your Hair Is Too Long, There\'s Sin In Your Heart', NULL),
('1054248', 'Billy Strings: 2022.11.12 - The Met - Philadelphia, PA', '2022-11-12', '/wMVTDPGChJOnspIb7VQ9grySsDx.jpg', 'Set 1: 1. Taking Water 2. Ice Bridges 3. In The Morning Light 4. Must Be Seven 5. Pyramid Country 6. Ole Slewfoot 7. Nothing\'s Working 8. Cold On The Shoulder 9. Slow Train 10. A Face In The Crowd 11. Highway Hypnosis 12. Open Up Them Pearly Gates 13. Dreadful Wind & Rain 14. Sally Goodin\'  Set 2: 1. Everything\'s The Same 2. Doin’ Things Right 3. Southern Flavor 4. Dealing Despair 5. Leaders 6. All Fall Down 7. Running The Route 8. Running 9. Rank Stranger 10. Psycho 11. Hide & Seek  Encore: 1. Hold That Woodpile Down', NULL),
('1054249', 'Billy Strings: 2022.11.13 - The Met - Philadelphia, PA', '2022-11-13', '/tZR7mTAOzKYCIBo9Kmu3ZmZtCyl.jpg', 'Set 1: 1. The Fire On My Tongue 2. Black Clouds 3. Way Downtown 4. End Of The Rainbow 5. While I’m Waiting Here 6. Shenandoah Breakdown 7. Heartbeat Of America 8. Fiddling Around 9. Dust In A Baggie 10. Freight Train Boogie\r Set 2: 1. On The Line 2. Train 45 3. Ernest T. Grass 4. How Mountain Girls Can Love 5. Fire Line 6. Thirst Mutilator 7. Hollow Heart 8. Make Me A Pallet On Your Floor 9. Streamline Cannonball 10. Love & Regret 11. I\'ll Remember You, Love, In My Prayers 12. Bronzeback 13. Look Up, Look Down That Lonesome Road 14. Turmoil & Tinfoil  Encore: 1. I\'m Gone, Long Gone', NULL),
('1054250', 'BIlly Strings: 2022.11.16 - Virginia Credit Union - Richmond, VA', '2022-11-16', '/ibbDjWzpSP8BBLk3bgRqCM3kWuZ.jpg', 'Set 1: 1. Red Daisy 2. While I’m Waiting Here 3. Pyramid Country 4. John Hardy 5. This Old World 6. Hollow Heart 7. Everything\'s The Same 8. In The Morning Light 9. All Time Low 10. Running 11. Shenandoah Waltz 12. Turmoil & Tinfoil  Set 2: 1. Know It All 2. Enough To Leave 3. Dust In A Baggie 4. Think Of What You\'ve Done 5. Watch It Fall 6. Don\'t Let Your Deal Go Down 7. The White Dove 8. Away From The Mire 9. Last Day At Gettysburg 10. Dusty Miller 11. Must Be Seven 12. Blue Virginia Blues 13. Hide & Seek  Encore: 1. Freedom', NULL),
('436270', 'Black Adam', '2022-10-21', '/pFlaoHTZeyNkG83vxsAJiGzfSsa.jpg', 'Nearly 5,000 years after he was bestowed with the almighty powers of the Egyptian gods—and imprisoned just as quickly—Black Adam is freed from his earthly tomb, ready to unleash his unique form of justice on the modern world.', NULL),
('457232', 'Lamborghini: The Man Behind the Legend', '2022-11-18', '/RKgnYLhCNGCUkrhiCRrs40rEHe.jpg', 'Follow the launch of Lamborghini’s career as a manufacturer of tractors, a creator of military vehicles during World War II, and the designer of Lamborghini cars, which he launched in 1963 as the high-end sports car company Automobili Lamborghini.', NULL),
('497828', 'Triangle of Sadness', '2022-10-07', '/fgy78BLl0gk8OzTWHZyGrSlIEON.jpg', 'A celebrity model couple are invited on a luxury cruise for the uber-rich, helmed by an unhinged captain. What first appeared Instagrammable ends catastrophically, leaving the survivors stranded on a desert island and fighting for survival.', NULL),
('505642', 'Black Panther: Wakanda Forever', '2022-11-11', '/sv1xJUazXeYqALzczSZ3O6nkH75.jpg', 'Queen Ramonda, Shuri, M’Baku, Okoye and the Dora Milaje fight to protect their nation from intervening world powers in the wake of King T’Challa’s death. As the Wakandans strive to embrace their next chapter, the heroes must band together with the help of War Dog Nakia and Everett Ross and forge a new path for the kingdom of Wakanda.', NULL),
('511817', 'Wendell & Wild', '2022-10-21', '/5dsX6UAHqkQz1kiV8bs8SvjyVNa.jpg', 'Two demon brothers enlist the aid of Kat Elliot — a tough teen with a load of guilt — to summon them to the Land of the Living. But what Kat demands in return leads to a brilliantly bizarre and comedic adventure like no other.', NULL),
('541134', 'The Good Nurse', '2022-10-19', '/rSq6cq0LCcbro10jbEaPTEb3WmW.jpg', 'Suspicious that her colleague is responsible for a series of mysterious patient deaths, a nurse risks her own life to uncover the truth.', NULL),
('555604', 'Guillermo del Toro\'s Pinocchio', '2022-11-18', '/vx1u0uwxdlhV2MUzj4VlcMB0N6m.jpg', 'During the rise of fascism in Mussolini\'s Italy, a wooden boy brought magically to life struggles to live up to his father\'s expectations.', NULL),
('560052', 'My Father\'s Dragon', '2022-11-04', '/6hgEe1w0An5fKi3ZqIUBwOyIN2y.jpg', 'Struggling to cope after a move to the city with his mother, Elmer runs away in search of Wild Island and a young dragon who waits to be rescued. Elmer’s adventures introduce him to ferocious beasts, a mysterious island and the friendship of a lifetime.', NULL),
('579496', 'Call Jane', '2022-10-28', '/n3oV6065tgYpukAjLxSbWcfqdg9.jpg', 'A married woman with an unwanted pregnancy lives in a time in America where she can\'t get a legal abortion and works with a group of suburban women to find help.', NULL),
('588921', 'AINBO: Spirit of the Amazon', '2022-11-08', '/sKJcrnjngg6rcl9khSBFGCI62VM.jpg', 'An epic journey of a young hero and her Spirit Guides, \'Dillo\' a cute and humorous armadillo and \"Vaca\" a goofy oversized tapir, who embark on a quest to save their home in the spectacular Amazon Rainforest.', NULL),
('590211', 'Silent Life', '2022-11-19', '/wxE31WGfHb8Hhu0UUwgccFaFR3.jpg', '1926: While on tour promoting his latest movie \"Son Of The Sheik\", Rudolph Valentino, the Hollywood silent screen icon, suffers a sudden collapse and is hospitalized at the New York Polyclinic Hospital. After an emergency surgery, Valentino loses his grip on reality and, while hallucinating, reexperiences his life in Hollywood from - as a silent film shown at a movie palace, the magical portal between life and eternity, between reality and illusion. Dubbed \"The Great Lover\" around the world, Valentino plays dashing and virile Sheiks on the screen and drives his female audience into hysteria. However, his private life is a complete failure - the Sheik cannot satisfy even his own domineering wife. Snapping back to reality, Valentino finds himself abandoned, alone and stricken with illness. Pam, a young deaf-mute Valentino\'s fan, who works as a nurses\' aid at the hospital, will show the God of Love for the first time in his life what love can truly mean.', NULL),
('593643', 'The Menu', '2022-11-18', '/v31MsWhF9WFh7Qooq6xSBbmJxoG.jpg', 'A couple travels to a coastal island to eat at an exclusive restaurant where the chef has prepared a lavish menu, with some shocking surprises.', NULL),
('595586', 'Causeway', '2022-10-28', '/bUzKIqFIS05Ss31zRTfZfHJIgDP.jpg', 'A US soldier suffers a traumatic brain injury while fighting in Afghanistan and struggles to adjust to life back home in New Orleans. When she meets local mechanic James, the pair begin to forge an unexpected bond.', NULL),
('603204', 'Stars at Noon', '2022-10-14', '/viR50oQCs8ObciADFGWHUyChexZ.jpg', 'In present-day Nicaragua, a headstrong American journalist and a mysterious English businessman strike up a romance as they become embroiled in a dangerous labyrinth of lies and conspiracies and are forced to try and escape the country.', NULL),
('615952', 'Armageddon Time', '2022-10-28', '/2bVjSEaLsUxUZ4Dutz9qRF5zXyd.jpg', 'In 1980, Queens, New York, a young Jewish boy befriends a rebellious African-American classmate to the disapproval of his privileged family and begins to reckon with growing up in a world of inequality and prejudice.', NULL),
('616820', 'Halloween Ends', '2022-10-14', '/yoAKHpveZ4Z1wwwXoD31dXj3H8s.jpg', 'Four years after the events of Halloween in 2018, Laurie has decided to liberate herself from fear and rage and embrace life. But when a young man is accused of killing a boy he was babysitting, it ignites a cascade of violence and terror that will force Laurie to finally confront the evil she can’t control, once and for all.', NULL),
('623112', '10 Double Zero', '2022-11-17', '/280AKYNqttf0QjvfhGBE7CV5XpV.jpg', 'Set in the stifling heat of Louisiana, two police officers take on a personal vendetta to hunt down cop killers, but as they get closer to solving the crime, they find themselves targets of a conspiracy in the ranks of the police force as the investigation leads right back to them', NULL),
('629542', 'The Bad Guys', '2022-04-22', '/6fcFmdVLCCbf1gFt8HlC6BRj8pt.jpg', 'When the Bad Guys, a crew of criminal animals, are finally caught after years of heists and being the world’s most-wanted villains, Mr. Wolf brokers a deal to save them all from prison.', NULL),
('632856', 'Spirited', '2022-11-10', '/h3zAzTMs5EP3cKusOxFNGSFE1WI.jpg', 'Each Christmas Eve, the Ghost of Christmas Present selects one dark soul to be reformed by a visit from three spirits. But this season, he picked the wrong Scrooge. Clint Briggs turns the tables on his ghostly host until Present finds himself reexamining his own past, present and future.', NULL),
('637312', 'Dinner with Leatherface', '2022-10-28', '/okgrTxL6TLsC5rpzRD7S5MQCGgx.jpg', 'A look at poet, author, filmmaker, actor and horror icon, Gunnar Hansen, the original Leatherface in the first Texas Chainsaw Massacre, from friends, colleagues, filmmakers, actors and anyone who knew one of the nicest people affiliated with the horror genre.', NULL),
('642781', 'The Barn Part II', '2022-11-17', '/zBiQ91DoP6JutoU3R4mfvYXLuVv.jpg', 'The Halloween ban is now lifted in Helen\'s Valley, and the sorority girls of Gamma Tau Psi place Michelle in charge of their annual haunted house. Unfortunately for Michelle some uninvited trick or treaters from her past come knocking.', NULL),
('646473', 'Dear Zoe', '2022-11-04', '/imRd5Qsltoa12JQ2uanNlwnWRRs.jpg', 'Tess enlists her biological father - a lovable slacker from the wrong side of the tracks - and the charming juvenile delinquent next door to help her come to grips with the death of her little sister.', NULL),
('653851', 'Devotion', '2022-11-23', '/mOuU9z8nrBaEkS5D6z8IPTxIZC9.jpg', 'The harrowing true story of two elite US Navy fighter pilots during the Korean War. Their heroic sacrifices would ultimately make them the Navy\'s most celebrated wingmen.', NULL),
('660175', 'Edgar Allen Poe\'s Ligeia', '2022-10-31', '/1TnVMl4NZZkt5vMxR5eTrkqdbTo.jpg', 'A young artist, imprisoned within the trammels of opium addiction, relives his phantasmagorical courtship with a mysterious Soprano known only as Ligeia. While exploring these opium induced memories, the lines dividing reality and fantasy, memory and hallucination, begin to blur into an indecipherable labyrinth of obsession and despair. Though he is nursed back to health by a new love, the Lady Rowena, the haunting of Ligeia\'s memories as well as the spirits of Azrael and Nehushtan, continue to plague his mind and soul.', NULL),
('660943', 'Memories of My Father', '2022-11-18', '/jWAwnYv5osJuth6G0lwPoQD06gs.jpg', 'In the polarized and violent Medellín (Colombia\'s \'City of Eternal Spring\') of the 1970s, doctor Héctor Abad Gómez is concerned about both his children and children from less favored classes. After a devastating loss in the family, Héctor gives himself to the greater cause of public health programs for the poor in Medellín to the consternation of the city\'s authorities.', NULL),
('661374', 'Glass Onion: A Knives Out Mystery', '2022-11-23', '/vDGr1YdrlfbU9wxTOdpf3zChmv9.jpg', 'Intrepid detective Benoit Blanc finds himself at a lavish private estate on a Greek island, but how and why he comes to be there is only the first of many puzzles. Blanc soon meets a distinctly disparate group of friends gathering at the invitation of billionaire Miles Bron for their yearly reunion. As in all the best murder mysteries, each person harbors their own secrets, lies and motivations. And when someone turns up dead, everyone is a suspect.', NULL),
('662707', 'Starbright', '2022-10-28', '', 'A young orphan escapes the realities of her life by fantasizing about, and then entering, a fairy tale world.', NULL),
('674324', 'The Banshees of Inisherin', '2022-10-21', '/dpeR3ue0Q93Rk8jhE2DzVPMRGIm.jpg', 'Two lifelong friends find themselves at an impasse when one abruptly ends their relationship, with alarming consequences for both of them.', NULL),
('676547', 'Prey for the Devil', '2022-10-28', '/w3s6XEDNVGq5LUlghqs6VlvsvL6.jpg', 'In response to a global rise in demonic possessions, the Catholic Church reopens exorcism schools to train priests in the Rite of Exorcism. On this spiritual battlefield, an unlikely warrior rises: a young nun, Sister Ann. Thrust onto the spiritual frontline with fellow student Father Dante, Sister Ann finds herself in a battle for the soul of a young girl and soon realizes the Devil has her right where he wants her.', NULL),
('685691', 'BARDO, False Chronicle of a Handful of Truths', '2022-11-04', '/3e6RA0CzFDC0pz5TqiRlbHcsc2n.jpg', 'A renowned Mexican journalist and documentary filmmaker living in Los Angeles, after being named the recipient of a prestigious international award, is compelled to return to his native country, unaware that this simple trip will push him to an existential limit.', NULL),
('689703', 'The Alien Report', '2022-10-23', '/yd3LzKG8DkkRFrNUQaTsxvCuM3w.jpg', 'A life-long alien abductee figures out a clever way to record his alien encounters using a micro camera, and shares high-res video of telepathic beings, human hybrids and more.', NULL),
('696372', 'A Chance Encounter', '2022-10-28', '/9KfxFc6zm3hUB0lt7yJf5iJPh8C.jpg', 'In the Sicilian town of Taormina, Italy, an aspiring writer in search of inspiration meets a folk singer trying to write a follow up to her breakout hit. Their chemistry sparks collaboration, challenging each other to express their thorniest secrets.', NULL),
('703285', 'Please Baby Please', '2022-10-28', '/csdPm6ROtpfvZCvLmPioi48jg6M.jpg', 'After witnessing a murder in the gritty streets of 1950s Manhattan, newlyweds Suze and Arthur become the dangerous obsession of a greaser gang that awakens a sleeping quandary into the couple\'s sexual identity.', NULL),
('705996', 'Decision to Leave', '2022-10-14', '/N0rskx91Eh6aWjvBybeY6epNic.jpg', 'From a mountain peak in South Korea, a man plummets to his death. Did he jump, or was he pushed? When detective Hae-joon arrives on the scene, he begins to suspect the dead man’s wife Seo-rae. But as he digs deeper into the investigation, he finds himself trapped in a web of deception and desire.', NULL),
('714968', 'Plan A', '2022-10-14', '/nPN7ksVj4pCOBEzKkis7tUtBmLQ.jpg', 'Germany 1945, Max, a Jewish Holocaust survivor, meets a radical group of Jewish resistance fighters, who, like him, lost all hope for their future after they were robbed of their existence and their entire families were killed by the Nazis. They dream of retaliation on an epic scale for the Jewish people. An eye for an eye, a tooth for a tooth. Max starts identifying with the group\'s monstrous plans...', NULL),
('729454', 'Don’t Fuck in the Woods 2', '2022-10-24', '/A2JJzUkeTA9zHYJRkds2sCMai4D.jpg', 'The counselors of Pine Hills Summer Camp are getting the grounds ready for the season. While they set up, a mysterious girl enters the camp after a night of bloodshed. And there are things following her as well.', NULL),
('744114', 'My Policeman', '2022-10-21', '/wdbiMjXd4CxPfCx4r4Jfy8cGec0.jpg', 'In the late 1990s, the arrival of elderly invalid Patrick into Marion and Tom’s home triggers the exploration of seismic events from 40 years previous: the passionate relationship between Tom and Patrick at a time when homosexuality was illegal.', NULL),
('744594', 'White Noise', '2022-11-25', '/sXFRM14wo5zHFDqqC0QtW7Qy4vL.jpg', 'Jack Gladney, professor of Hitler studies at The-College-on-the-Hill, husband to Babette, and father to four children/stepchildren, is torn asunder by a chemical spill from a rail car that releases an “Airborne Toxic Event”, forcing Jack to confront his biggest fear – his own mortality.', NULL),
('754452', 'The Last Manhunt', '2022-11-18', '/95Bn6HZBBJcG7LOBMAzNH0gmLih.jpg', 'In 1909, Willie Boy and his love Carlota go on the run after he accidentally shoots her father in a confrontation gone terribly wrong. With President Taft coming to the area, the local sheriff leads two Native American trackers seeking justice for their “murdered” tribal leader.', NULL),
('760204', 'The Lair', '2022-10-28', '/ifRFLx83Xk1DcwAS3OScgI6HmWO.jpg', 'Royal Air Force pilot Lt. Kate Sinclair is on her final flight mission when her jet is shot down over one of the most dangerous rebel strongholds in Afghanistan. She finds refuge in an abandoned underground bunker where deadly man-made creatures known as Ravagers — half-human, half-alien, and hungry for human flesh — are awakened.', NULL),
('762895', 'Manifest West', '2022-11-11', '/lAxUEIHjzqYcatkYKKEOudJW2mA.jpg', 'A coming of age story told through the eyes of a young girl whose family spirals out of control after they decide to live off the grid.', NULL),
('766220', 'Old Man', '2022-10-14', '/hBkTcM3xhNCDaSn08RxvcFAejUJ.jpg', 'Deep in the woods, a lost hiker stumbles upon the cabin of an erratic and reclusive old man. What starts off as cordial conversation soon turns dangerous as it becomes clear that one or both of them might be hiding a terrifying secret.', NULL),
('774301', 'American Murderer', '2022-10-21', '/sfCmTkVVtwoW4yNu1Cs4ZDtCTa5.jpg', 'The True story of how charismatic con man Jason Derek Brown bankrolls his extravagant lifestyle through a series of scams. On Brown’s trail: Lance Leising, a dogged FBI special agent determined to put Brown behind bars. When Brown’s funds run low and his past catches up with him, he plots his most elaborate scheme yet, pitting himself against Leising in a deadly game of cat and mouse — and becoming the most unlikely and elusive fugitive on the FBI’s most-wanted list.', NULL),
('776659', 'Brother\'s Keeper', '2022-10-21', '/yTqV0pzQkbpTs8olGghxOy3gwUX.jpg', 'Yusuf and his best friend Memo are pupils at a boarding school for Kurdish boys, secluded in the mountains of Eastern Anatolia. When Memo falls mysteriously ill, Yusuf is forced to struggle through the bureaucratic obstacles put up by the school\'s repressive authorities to try to help his friend. But by the time the adults in charge finally understand the seriousness of Memo\'s condition and try to get him to the hospital, the school has been buried under a sudden, heavy snowfall. With no way out and now desperate to reach help, teachers and pupils engage in a blame game where grudges, feelings of guilt and hidden secrets emerge, as time ticks mercilessly on and threatens to run out.', NULL),
('779157', 'Puppet Master: Doktor Death', '2022-10-28', '/iufcVFJ5b5PXkU5sMY7uLuCFAgx.jpg', 'In this stand-alone spin-off of Retro Puppet Master, a beautiful young med student is trapped in an erotic nightmare and must face-off against the demon that inhabits the evil puppet.', NULL),
('782936', 'Nocebo', '2022-11-04', '/7aQIyXUDqVAPJQzm5BPaW8jbzCu.jpg', 'A fashion designer hires a nanny from the Philippines to assist her in caring for her family while she is suffering from what she believes is a tick-related illness. The nanny uses traditional Filipino folk healing techniques to help her, but in the process of doing so, she uncovers a horrifying truth about why she is there and why her employer is actually sick.', NULL),
('785398', 'EO', '2022-11-18', '/1MK86Vr2nf1GSYOtRd8pFvA5RM8.jpg', 'The world is a mysterious place when seen through the eyes of an animal. EO, a grey donkey with melancholic eyes, meets good and bad people on his life’s path, experiences joy and pain, endures the wheel of fortune randomly turn his luck into disaster and his despair into unexpected bliss. But not even for a moment does he lose his innocence.', NULL),
('786415', 'Iké Boys', '2022-10-11', '/wzAZnkTQZBGCxZTvZk5g5VzgKuR.jpg', 'Two Japan-obsessed teenagers in Oklahoma must discover their inner hero when a magical anime transforms them into its super-powered characters.', NULL),
('791177', 'Bones and All', '2022-11-18', '/dBQuk2LkHjrDsSjueirPQg96GCc.jpg', 'Abandoned by her father, a young woman embarks on a thousand-mile odyssey through the backroads of America where she meets a disenfranchised drifter. But despite their best efforts, all roads lead back to their terrifying pasts and to a final stand that will determine whether their love can survive their otherness.', NULL),
('796765', 'Bantú Mama', '2022-11-17', '/wjmWQguhRsmq0zergG7ZnoX4JMj.jpg', 'A French woman of African descent manages to escape after being arrested in the Dominican Republic. She finds shelter in the most dangerous district of Santo Domingo, where she is taken in by a group of children. By becoming their protégée and maternal figure, she will see her destiny change inexorably.', NULL),
('800282', 'I\'m Totally Fine', '2022-11-04', '/4eCfOPqoE5ezwQCgVGQszwlxdJh.jpg', 'A woman in mourning takes a solo trip to clear her head after the death of her friend. However, Vanessa’s self-care vacation plans change when she’s met with a situation out of this world.', NULL),
('800939', 'Ticket to Paradise', '2022-10-21', '/1tzERH50P5c2mFWtLbgixzLZS1L.jpg', 'A divorced couple teams up and travels to Bali to stop their daughter from making the same mistake they think they made 25 years ago.', NULL),
('804095', 'The Fabelmans', '2022-11-11', '/zrh0bv8L6DXl2Es07Hc6Aajkqnj.jpg', 'A coming-of-age story about a young man’s discovery of a shattering family secret and an exploration of the power of movies to help us see the truth about each other and ourselves.', NULL);
INSERT INTO `films` (`id`, `title`, `release_date`, `poster_path`, `overview`, `poster`) VALUES
('806368', 'The Son', '2022-11-25', '/1AMsm4AUXn0jkxDByXKWYuUKRV7.jpg', 'A successful lawyer, with a new wife and infant, agrees to care for his teenage son from a previous marriage after his ex becomes concerned about the boy\'s wayward behavior.', );
INSERT INTO `films` (`id`, `title`, `release_date`, `poster_path`, `overview`, `poster`) VALUES
('809980', '1946: The Mistranslation That Shifted Culture', '2022-11-12', '/4Mc8vXszLyrNP1scJxFwN0HI7JD.jpg', 'A journey which unveils the mystery of how theology, history, culture, and politics led to a Biblical mistranslation, the man who tried to stop it, and the impassioned academic crusade of the LGBTQIA+ Christian community-driven to discover the truth.', NULL),
('815144', 'Where Are You', '2022-10-21', '/qRYc83feF6KonWvV5p5ZLy9h1Ab.jpg', 'A photographer suffering under artist decline begins taking out his aggression on his girlfriend. When she disappears, he enters his subconscious, descending down a spiral of mystery and madness on his search for her, as well as himself.', NULL),
('817127', 'Brainwashed: Sex-Camera-Power', '2022-10-21', '/zqklSVRTxlC92VnhXyCPCVEnAzH.jpg', 'Investigates the politics of cinematic shot design, and how this meta-level of filmmaking intersects with the twin epidemics of sexual abuse/assault and employment discrimination against women, with over 80 movie clips from 1896 - 2020.', NULL),
('817758', 'TÁR', '2022-10-07', '/dRVAlaU0vbG6hMf2K45NSiIyoUe.jpg', 'Renowned musician Lydia Tár is days away from recording the symphony that will elevate her career. When all elements seem to conspire against her, Lydia\'s adopted daughter Petra becomes an integral emotional support for her struggling mother.', NULL),
('823766', 'The Wonder', '2022-11-02', '/npBvD1rRQHYGrxuwr2OrzXLso1w.jpg', 'Haunted by her past, a nurse travels from England to a remote Irish village in 1862 to investigate a young girl\'s supposedly miraculous fast.', NULL),
('827484', 'In the Court of the Crimson King: King Crimson at 50', '2022-10-19', '/4AwJz4d1xJKH4Li7F3GIQOblWp2.jpg', 'The film explores the “acute suffering” and transcendent glory experienced by current and former members of King Crimson, allowing the audience an intimate and sometimes uncomfortable insight into the musicians’ experience as they confront life and death head on in the world’s most demanding rock band.', NULL),
('829799', 'Paradise City', '2022-11-11', '/uGuHHS9SWv7MrFhCH6zoGGd7DA8.jpg', 'Renegade bounty hunter Ryan Swan must carve his way through the Hawaiian crime world to wreak vengeance on the kingpin who murdered his father.', NULL),
('837881', 'She Said', '2022-11-18', '/l5L49fB2xPnfXwbb8pd5szWUk8e.jpg', 'New York Times reporters Megan Twohey and Jodi Kantor break one of the most important stories in a generation — a story that helped launch the #MeToo movement and shattered decades of silence around the subject of sexual assault in Hollywood.', NULL),
('837938', 'The Inspection', '2022-11-18', '/w7m962Crc1p4C4gM6ZJBArAikM9.jpg', 'Ellis French is a young, gay Black man, rejected by his mother and with few options for his future, decides to join the Marines, doing whatever it takes to succeed in a system that would cast him aside. But even as he battles deep-seated prejudice and the grueling routines of basic training, he finds unexpected camaraderie, strength, and support in this new community, giving him a hard-earned sense of belonging that will shape his identity and forever change his life.', NULL),
('842934', 'Poker Face', '2022-11-16', '/8a2MIBV9LuPYbF5rOEAohjjMz9P.jpg', 'A yearly high-stakes poker game between childhood friends turns into chaos when the tech billionaire host unveils an elaborate scheme to seek revenge for the ways they\'ve betrayed him over the years. But as his plans unfold, a group of thieves hatch plans of their own breaking into the mansion thinking it is empty. The old friends quickly band together and the years of playing the game help them win their way through a night of terror.', NULL),
('843621', 'Something in the Dirt', '2022-11-04', '/l0kUj5y1t6LDN9ssfYe7c1NVym1.jpg', 'When neighbors John and Levi witness supernatural events in their LA apartment building, they realize documenting the paranormal could inject some fame and fortune into their wasted lives.', NULL),
('843932', 'Nanny', '2022-11-23', '/8qioumLk62Ot1mh9Vom1TXYky6W.jpg', 'Aisha, an undocumented immigrant, lands a job as a nanny for a wealthy Manhattan couple. As she prepares for the arrival of the son she left behind in Senegal, a violent presence begins to invade both her dreams and her reality, threatening to destroy the American Dream she is painstakingly piecing together.', NULL),
('844396', 'The Friendship Game', '2022-11-11', '/qXaJkaVTNMhrOylFi6xrWnBQGE8.jpg', 'A group of teens in a small town come across a strange object that tests their loyalties to each other with increasingly destructive consequences the deeper into the game they go.', NULL),
('844404', 'Sam & Kate', '2022-11-11', '/fzQN7YcIgboMavMMwrOTaqz8agm.jpg', 'Bill is an ailing larger-than-life father being taken care of by his son Sam, who has returned home to care for him. While home, Sam falls for a local woman, Kate. At the same time, Bill starts to fall for her mom, Tina.', NULL),
('844547', 'Taurus', '2022-11-18', '/bWH1s160oYX1vybg3zPnL4ygMpw.jpg', 'A rising but troubled musician searches for the inspiration to record one last song, pushing himself deep into the void.', NULL),
('850049', 'It\'s Happening Right Here', '2022-11-03', '/kC8wYs3UqU2pRZmXK6lJjexijAu.jpg', 'This documentary unveils the truth that sex trafficking can happen in every community in the U.S.. Awareness about online grooming, sextortion, and trafficking, along with preventative tools, are examined through interviews with law enforcement, technology experts, and survivors. Despite the darkness of this crime, hope can be found in the organizations fighting to end trafficking and those sharing their experiences to protect others.', NULL),
('852252', 'The Accursed', '2022-10-14', '/27IgOiz7Vp19ei13pnRdOir7SD8.jpg', 'Elly is asked by a family friend to spend a few days looking after an elderly woman living in a remote cabin. She readily agrees thinking a short trip to the woods will be a nice escape. The cabin turns out to be anything but relaxing as Elly begins hallucinating in ways that blur reality with her dreams. As the visions take over, Elly realizes that she was lured there by a demonic presence hiding inside of the woman just waiting to break free.', NULL),
('852917', 'A Savannah Haunting', '2022-10-28', '/fpxmnwY9mQk05JVya6lsbvUm3mW.jpg', 'Based on true events and filmed in the actual haunted house upon which the script is based, A Savannah Haunting is a chilling supernatural thriller about a family that is torn apart by evil forces inside their new home.', NULL),
('854239', 'Till', '2022-10-14', '/eemXvyp8Dfdhf3fcKatwNbxbB7R.jpg', 'The true story of Mamie Till Mobley’s relentless pursuit of justice for her 14 year old son, Emmett Till, who, in 1955, was lynched while visiting his cousins in Mississippi.', NULL),
('855166', 'You Resemble Me', '2022-11-04', '/bijSzi4FkrMc2q8i6HE6R5E1cEU.jpg', 'Two sisters are abruptly separated, the eldest, Hasna, struggles to find her identity and place in the world.', NULL),
('862553', 'Bar Fight', '2022-11-11', '/wz3LJM9tVUgatlS1WhedZRju1ON.jpg', 'Nina and Allen split everything in their lives 50/50 after their break-up to avoid any drama—everything, that is, except for their favorite local bar. Nina and Allen must compete in a ridiculous, tavern-style custody battle for their prized watering hole, in which lines will be drawn, sides will be chosen, and beers will be drunken.', NULL),
('866076', 'The Same Storm', '2022-10-14', '/2CHwhPFEjnQtPxuDYPW2dBpwVqn.jpg', 'Snapshots of the tumults of the COVID-19 pandemic.', NULL),
('869025', 'Raymond & Ray', '2022-10-14', '/fdKZmSQHD17JjGUYkluhpttgJRi.jpg', 'Half brothers Raymond and Ray reunite when their estranged father dies—and discover that his final wish was for them to dig his grave. Together, they process who they’ve become as men, both because of their father and in spite of him.', NULL),
('872942', 'Quicksand', '2022-10-30', '', 'A young man is in over his head following a breakup and losing the ring for his best friend\'s wedding.', NULL),
('876327', 'Love, Charlie: The Rise and Fall of Chef Charlie Trotter', '2022-11-18', '/ljexfxrA7elGLb7Pjmykmz0pb6U.jpg', 'In the 2000s, chef Charlie Trotter was the toast of Chicago, his eponymous restaurant one of the world’s top fine-dining destinations. A gastronomic revolutionary and a culinary bad-boy, Trotter paved the way for the likes of Anthony Bourdain and Gordon Ramsay, yet his tempestuous, competitive nature alienated many. With never-before-seen archival material and new interviews with those who loved and loathed Trotter—who died from a stroke in 2013 at age 54—this absorbing, unvarnished profile chronicles the passions of a master chef and the consequences of pursuing perfection at all costs.', NULL),
('877269', 'Strange World', '2022-11-23', '/a9x70QUXs6uEwtin1SGNKoFXoia.jpg', 'A journey deep into an uncharted and treacherous land, where fantastical creatures await the legendary Clades—a family of explorers whose differences threaten to topple their latest, and by far most crucial, mission.', NULL),
('879444', 'Accident Man: Hitman\'s Holiday', '2022-10-14', '/zC5SJ18v9AhiHoFOIzZASqSxsPh.jpg', 'The Accident Man is back, and this time he must best the top assassins in the world to protect the ungrateful son of a mafia boss, save the life of his only friend and rekindle his relationship with his maniacal father figure.', NULL),
('880022', 'Medjugorje, la película', '2022-10-14', '/3RVcTwbFfh9iT5sIV5CDqsyVK4H.jpg', '', NULL),
('882109', 'The Christmas Spirit', '2022-10-14', '/6a8nocaDfYOehQzeqZMvni9WqVq.jpg', 'A lone man with the Christmas Spirit trapped in his head must kidnap a teenage girl in order to save Christmas.', NULL),
('882304', 'The Great Basin', '2022-11-14', '/vNxonJ4vPUmBUrYKNaFtgUYh8WX.jpg', 'Chivas DeVinck works his way up from the soil to the stars to find out what constitutes Nevada outside of Las Vegas. Milieus, places and people are intertwined in a collage. The magnetic core of the whole is the subterranean water from which everything seems to grow and for which everyone strives. What looks like an arid desert landscape or a sleepy little town from afar, turns out on closer inspection to be an atmospheric representation of the rural U.S.', NULL),
('884452', 'The Ambush', '2022-10-28', '/dEZJgTWjq5ex8lEvI6XcYMxnTSn.jpg', 'It is the winter of 2018, the men and women of the UAE military are deployed to provide aid. At the Mocha Base, spirits are high as three Emirati soldiers anticipate an imminent return home. While on their final routine patrol, the three soldiers, Ali, Bilal and Hindasi are ambushed by heavily armed militants on their route, through a narrow canyon. Trapped, wounded, and out of communication range, the three soldiers realize the gravity of their situation. They are running out of options, munitions - and time. Back at the base, their commander receives word and realizes that the assault on the UAE army patrol was premeditated. A rescue mission is quickly put into action, but will air and land support reach the men in time, and will they survive?', NULL),
('885903', 'Survivor\'s Choice', '2022-10-28', '/clbZJFNNlfX0Sh9MKRRpH13J8bA.jpg', 'Three members of an addictions anonymous group find themselves in a deadly escape room forced to face their most lethal challenge - their pasts.', NULL),
('888097', 'Slayers', '2022-10-21', '/1dgNc7FB5RMm6w4D6S0UpZhsUbW.jpg', 'A group of superstar influencers are drawn to a reclusive billionaire\'s mansion only to find themselves trapped in the lair of an evil vampire. The only way out is to be saved by a famous online gamer and an old school vampire hunter.', NULL),
('889699', 'Holy Spider', '2022-10-28', '/fiSU4G6IIcMN2Z8l34BZXqGSK6K.jpg', 'A journalist descends into the dark underbelly of the Iranian holy city of Mashhad as she investigates the serial killings of sex workers by the so called \"Spider Killer\", who believes he is cleansing the streets of sinners.', NULL),
('896634', 'Silent River', '2022-10-14', '/v3PtlKAUAeOM6nFm7Hf0sEcqtkm.jpg', 'Desperate to reconcile with his estranged wife, Elliot stops at a desert motel where he encounters Greta, an uncanny woman on the run from a mysterious past.', NULL),
('896689', 'Cat Daddies', '2022-10-14', '/pR2q5lX5VleEAh2qYq5iMSOCYuC.jpg', 'A heartwarming and tender portrait of men whose lives have been forever changed by their cats, CAT DADDIES takes us on an inspiring journey all across the United States.  These nine “cat dads” come from all walks of life – a firefighter, a truck driver, a Hollywood stuntman, an ad executive turned cat rescuer, a police officer, a software engineer, an actor/Instagram influencer, a school teacher and an undocumented and disabled immigrant living on the streets of New York City.  They couldn’t be any more different, but each of them has a compelling story to tell and share an unconditional love for their cats.  A refreshing and timely exploration of modern masculinity, CAT DADDIES shows us how being a “cat person” has no gender, and that the unlikely bond between man and cat is here to stay.', NULL),
('898770', 'The Wrath Within', '2022-10-31', '', 'Five friends revisit their hometown for their high school reunion. Soon they will learn that their quiet Texas town is the home of a long, sinister curse.', NULL),
('900667', 'One Piece Film Red', '2022-11-04', '/m80kPdrmmtEh9wlLroCp0bwUGH0.jpg', 'Uta — the most beloved singer in the world. Her voice, which she sings with while concealing her true identity, has been described as “otherworldly.” She will appear in public for the first time at a live concert. As the venue fills with all kinds of Uta fans — excited pirates, the Navy watching closely, and the Straw Hats led by Luffy who simply came to enjoy her sonorous performance — the voice that the whole world has been waiting for is about to resound.', NULL),
('910858', 'The Estate', '2022-11-04', '/mYgS4djsVj61kzEpX43LklGUfgK.jpg', 'Two sisters attempt to win over their terminally ill, difficult-to-please Aunt in hopes of becoming the beneficiaries of her wealthy estate, only to find the rest of their greedy family members have the same idea.', NULL),
('912035', 'A Unicorn for Christmas', '2022-11-04', '/4uz5ifWfeh7ePQBcpFNezNKwBJ7.jpg', 'A heartwarming tale about young Izzy who is not happy about having to move from the big city to the country when her family takes over an old farm. Things change for Izzy when she finds a small white pony named Snowflake and becomes convinced that the horse is a real unicorn.', NULL);
INSERT INTO `films` (`id`, `title`, `release_date`, `poster_path`, `overview`, `poster`) VALUES
('913689', 'Leonor Will Never Die', '2022-11-25', '/8eZUfPpPal6xjsgRZADT05jjepC.jpg', 'Fiction and reality blur when Leonor, a retired filmmaker, falls into a coma after a television lands on her head, compelling her to become the action hero of her unfinished screenplay.', );
INSERT INTO `films` (`id`, `title`, `release_date`, `poster_path`, `overview`, `poster`) VALUES
('913792', 'Meet Me in the Bathroom', '2022-11-04', '/3XNYt5zo3B8urZLiSXNavuHgmVC.jpg', 'An immersive journey through the New York music scene of the early 2000s. Set against the backdrop of 9/11, this documentary tells the story of how a new generation kickstarted a musical rebirth for New York City that reverberated around the world.', NULL),
('913820', 'Utama', '2022-11-04', '/y78mwhYxsAPbzRhdHWtEVlfFWH9.jpg', 'In the Bolivian altiplano, Virginio and Sisa, an elderly Quechua couple who have lived a quiet life for years, face an impossible dilemma during an unusually long drought: resist or be defeated by the hostile environment and the relentless passage of time.', NULL),
('913822', 'Descendant', '2022-10-21', '/sHd1OBpWLxSN5UPSJrjwYeT4PPZ.jpg', 'History exists beyond what is written. The Africatown residents in Mobile, Alabama, have shared stories about their origins for generations. Their community was founded by enslaved ancestors who were transported in 1860 aboard the last known and illegal slave ship, Clotilda. Though the ship was intentionally destroyed upon arrival, its memory and legacy weren’t. Now, the long-awaited discovery of the Clotilda’s remains offers this community a tangible link to their ancestors and validation of a history so many tried to bury.', NULL),
('913838', 'All That Breathes', '2022-10-21', '/4X01J7lpVdWWPTKvJKc2Zbqf9V.jpg', 'Against the darkening backdrop of New Delhi\'s apocalyptic air and escalating violence, two brothers devote their lives to protecting one casualty of the turbulent times: the bird known as the black kite.', NULL),
('923', 'Dawn of the Dead', '2022-10-28', '/rC3YUoxZFTJAyS4BcZr7TeykrYH.jpg', 'During an ever-growing epidemic of zombies that have risen from the dead, two Philadelphia SWAT team members, a traffic reporter, and his television-executive girlfriend seek refuge in a secluded shopping mall.', NULL),
('926682', 'Night of the Tommyknockers', '2022-11-25', '/tsjkYkj9SJPD5iE8AYIBROYpzrE.jpg', 'When miners blast for gold in the 1870\'s, they accidentally release ancient creatures known as Tommyknockers. The Town of Deer Creek, Nevada is soon under siege with only a handful of survivors held up in the local saloon.', NULL),
('927771', 'Guiltless', '2022-10-12', '/1peOEwz3dbXUCEXABJukWykCbpT.jpg', 'When 16-year old Samantha has the house to herself over the weekend, she plans a romantic night for her and her girlfriend. However, when an intruder makes his way into her home, it\'s fight or flight on a night that will change her life.', NULL),
('928713', 'The Novelist\'s Film', '2022-10-28', '/l3rj6icZntghY5MNtO3WNVchyUC.jpg', 'A female novelist takes a long trip to visit a bookstore run by a younger colleague who has fallen out of touch.', NULL),
('933965', 'The Return of Tanya Tucker: Featuring Brandi Carlile', '2022-10-21', '/lwQHwd9jiyKK5DaKLwYii8eirKn.jpg', 'Trailblazing, hell-raising country music legend Tanya Tucker defied the standards of how a woman in country music was supposed to behave. Decades after Tanya slipped from the spotlight, rising Americana music star Brandi Carlile takes it upon herself to write an entire album for her hero based on Tanya’s extraordinary life, spurring the greatest comeback in country music history. Taking stock of the past while remaining vitally alive in the present and keeping an eye on the future, The Return of Tanya Tucker is a rousing exploration of an unexpected friendship built on the joy of a perfectly timed creative collaboration.', NULL),
('934131', 'Soft & Quiet', '2022-11-04', '/atNLWJm8KO44xeVGxG4LAByr5tm.jpg', 'Elementary school teacher Emily is organizing a mixer of like-minded women, but an altercation between a woman from Emily’s past and the group leads to a volatile chain of events.', NULL),
('934194', 'Slash/Back', '2022-10-21', '/cPIv1GTZJokL5TasJxFfVNG9TiM.jpg', 'In a remote Arctic community, a group of Inuit girls fight off an alien invasion, all while trying to make it to the coolest party in town.', NULL),
('934222', 'The Pez Outlaw', '2022-10-21', '/aUDtVR3t0uCGWuXnVAUYMrv4Wqs.jpg', 'This incredible fish-out-of-water story follows the adventures of Steve Glew, a small-town Michigan farmer, who boards a plane for Eastern Europe soon after the fall of the Berlin Wall. His mission is to locate a secret factory that holds the key to the most desired and valuable pez dispensers. If he succeeds, he will pull his family out of poverty and finally find a purpose in his mundane life. Steve becomes the hero of his own adventure, smuggling the rarest of goods into the U.S. and making millions in the process. It was all magical, until his arch-nemesis, The Pezident decided to destroy him.', NULL),
('934293', 'Bad Axe', '2022-11-18', '/mMJewzDZVidGtOiZcGIvcDNrys9.jpg', 'A real-time portrait of 2020 unfolds as an Asian-American family in Trump’s rural America fights to keep their restaurant and American dream alive in the face of a pandemic, Neo-Nazis, and generational scars from the Cambodian Killing Fields.', NULL),
('934329', 'Sell/Buy/Date', '2022-10-14', '/vs1dyAQaqN69IIptxFfQSCtkFZn.jpg', 'A hybrid doc/narrative following Tony winning performer and comedian Sarah Jones. As a mixed-race Black woman in America, Sarah, alongside the multicultural characters she\'s known for, explores her own personal relationship to one of the most relevant issues in our current cultural climate: the sex industry, and the surprisingly diverse range of people whose lives it touches. Through interviews and monologues, this film poses the question: how can we as a society have a healthy relationship to sex, power, race and our economy, without exploitation or stigma? The goal is not to prescribe solutions, but to highlight the human faces and voices at the center of this subject.', NULL),
('934641', 'The Minute You Wake Up Dead', '2022-11-04', '/pUPwTbnAqfm95BZjNBnMMf39ChT.jpg', 'A stockbroker in a small southern town gets embroiled in an insurance scam with a next-door neighbor that leads to multiple murders when a host of other people want in on the plot. Sheriff Thurmond Fowler, the by-the-book town sheriff for over four decades, works earnestly to try and unravel the town’s mystery and winds up getting more than he bargained for.', NULL),
('935999', 'Hounded', '2022-10-21', '/cdVz9dUv2YvNQil4svLAiUTuY28.jpg', 'A stately home robbery takes an evil turn one night when a gang of young thieves are caught by the owners of the house and then hunted across the estate for the proprietor\'s entertainment.', NULL),
('942892', '1-800-Hot-Nite', '2022-11-04', '/kXVVQlTG3IOumGStU7TqVVvMSm4.jpg', 'When 13-year-old Tommy loses his parents to a drug raid, he turns to a phone sex operator (his fairy godmother) for help as he embarks on an urban odyssey to escape foster care with his two best friends.', NULL),
('948212', 'Only in Theaters', '2022-11-18', '/rUtnQTKOkRpB4SIbSfMPrb57InJ.jpg', 'Laemmle Theaters, the beloved art house cinema chain in Los Angles has an astonishing legacy, with ties to the origins of Hollywood. This is a story about a 3rd generation family business and their determination to survive.', NULL),
('949000', 'Eternal Spring', '2022-10-14', '/ilmtlLm7JJJMlRLoatCM6umKWYT.jpg', 'In March 2002, a state TV signal in China gets hacked by members of the banned spiritual group Falun Gong. Their goal is to counter the government narrative about their practice.  In the aftermath, police raids sweep Changchun City, and comic book illustrator Daxiong (Justice League, Star Wars), a Falun Gong practitioner, is forced to flee. He arrives in North America, blaming the hijacking for worsening an already violent repression. But his views are challenged when he meets the lone surviving participant to have escaped China, now living in Seoul, South Korea.', NULL),
('961427', 'Spirit Halloween: The Movie', '2022-09-30', '/akWDID6zfsWHJhGCAAcbwbytU55.jpg', 'A group of middle schoolers discover a Spirit Halloween store is haunted and must survive the night.', NULL),
('964909', 'Next Exit', '2022-11-04', '/n1x6VMvCwvs3dLH84N7cSrpT0yt.jpg', 'In a world where ghosts are real and front-page news, a controversial new medical procedure allows people to peacefully kill themselves. In the midst of this breakthrough, two strangers travel cross country together to end their lives, only to unexpectedly find what they’ve been missing along the way.', NULL),
('965150', 'Aftersun', '2022-10-21', '/jeXmhP2zbUkREMRqFOYIwQOk49T.jpg', '11-year-old Sophie takes a summer vacation to Turkey with her loving and idealistic father, Calum. Twenty years later, she reminisces about the experience and reflects on their relationship – and the parts of him she wasn\'t able to know.', NULL),
('965233', 'There There', '2022-11-18', '/g7jApDkhmb0OV7rHJ9JkzWAcSdM.jpg', 'Andrew Bujalski is back with a warped series of short scenes featuring two characters at a time that toy with our perceptions and expectations in an unhinged reality not far from our own.', NULL),
('972545', 'Good Night Oppy', '2022-11-04', '/7DTWN79hsN5AZEhW8w4SOquSI4D.jpg', 'The inspirational true story of Opportunity, a rover that was sent to Mars for a 90-day mission but ended up surviving for 15 years. Follow Opportunity’s groundbreaking journey on Mars and the remarkable bond forged between a robot and her humans millions of miles away.', NULL),
('979924', 'On the Line', '2022-11-04', '/a14BbSHvLgzCdbDD6tAL8OBVKL1.jpg', 'A provocative and edgy radio host must play a dangerous game of cat and mouse with a mysterious caller who\'s kidnapped his family and is threatening to blow up the whole station.', NULL),
('981199', 'Chasing', '2022-11-21', '/ggQMItJGtpzWjMG7VYPgd81ObP7.jpg', 'An American athlete is fed up with silver medals, a pro baseball career foiled by injury, and narrowly missing out on the Olympic rowing team. Restless and looking for a win, he discovers a 3,000- mile rowing race. Jason aims to win the race and smash the record for the fastest crossing. Ten days in, two of the four men jump ship mid-Atlantic. Jason limps to the finish line, battered and humbled. One year later, he’s back with a new team. When seasickness and weather threaten his dream again, Jason faces an impossible task: 400 miles in just 5 days to beat the record.', NULL),
('983556', 'Planning for Joy', '2022-11-19', '/bXC3mCUMryXtwH2l6TkYpAJ174s.jpg', 'Hazel is launching a product to encourage the joy in organization, but clams up when she has to promote the product on a Boston morning show. Theo, who is a trivia host agrees to help her prepare for her second chance on the show.', NULL),
('987694', 'The Metropolitan Opera: Medea', '2022-10-22', '/cbenh8FHQlqQtBEDeaaN7w1oSuU.jpg', 'Having triumphed at the Met in some of the repertory’s fiercest soprano roles, Sondra Radvanovsky stars as the mythic sorceress who will stop at nothing in her quest for vengeance. Joining Radvanovsky in the Met-premiere production of Cherubini’s rarely performed masterpiece is tenor Matthew Polenzani as Medea’s Argonaut husband, Giasone; soprano Janai Brugger as her rival for his love, Glauce; bass Michele Pertusi as Glauce’s father, Creonte, the King of Corinth; and mezzo-soprano Ekaterina Gubanova as Medea’s confidante, Neris. Carlo Rizzi conducts.', NULL),
('992277', 'The Loneliest Boy In The World', '2022-10-14', '/cLEYxnzxHlAVhgjtGoO8cQZTQnO.jpg', 'After losing his mother, a lonely boy decides to (literally) dig up some new friends, but when they mysteriously come back to life, he’s launched into a series of misadventures as he tries to keep their secret safe from neighbors, classmates and social workers alike.', NULL),
('994441', 'Summit Fever', '2022-10-14', '/rX9k5v7JYmnaBO5E89PZ4yMfuvo.jpg', 'A daring dream to scale the world\'s most challenging trio of mountains soon turns into a terrifying nightmare for a group of friends when a deadly storm traps the climbers near the summit and cuts off all hope of rescue. With the odds stacked against them, the friends are forced to trust each other to save themselves by any means necessary.', NULL),
('998134', 'Harvested 2', '2022-11-24', '/4MJK0zWqLl5IXFt3vZ3iB7VNiqn.jpg', 'Harvested 2 (2022), The Legend of Harold Rice is the holiday horror sequel to Harvested (2021). The story of a group of social media influencers who travel to Hayfork, CA on Thanksgiving Day to get footage of the Harvest Monster aka Harold Rice. While chasing fame, fortune and likes, they soon come face to face with the urban legend who owns the night. Although the plot is predicated on influencer culture and social media relevancy, Harvested 2 has elements from horror films of the 60\'s, 70\'s, and 80\'s as well as 90\'s slasher vibes.  Cortney Elise, will be making her streaming debut along-side Ruby Lee Dove, Hana Wu, Meg Cherilus, Amber Perez, Jenna Nimri and Gregor Haley. Written and Directed by the 23X international award winning filmmaker Alex West, Harvested 2 will be released to streaming on Thursday November 24, 2022 where it will be FREE to the public. Because it is a Culture Forward TV original film, it will only be available on Culture Forward TV on Roku!', NULL);
